import React from 'react';
import logo from './logo.svg';
import './App.css';

function App(props) {
  return (
    <div id='game-page-layout'>
      <NavBar name='Eloise Maun' phone='(802) 793-2515' email='eloise@maun.me'/>
    </div>
  );
}

function NavBar(props) {
    return (
        <div class="navbar justify-content-center fixed-top">
            <h1 class="d-block">{props.name}</h1>
            <p class="contact" class="d-block">{props.phone} &mdash; {props.email}</p>
        </div>
    );
}


export default App;
